    number = passedNumber;
}

const SetCardInfoMonth = (passedExpMonth) => {
    expMonth = passedExpMonth;
}

const SetCardInfoYear = (passedExpYear) => {
    setExpYear(expYear);
}

const SetCardInfoCVC = (cvc) => {
    setCVC(cvc);
}


export default {
    SetCardInfoName, 
    SetCardInfoNumber, 
    SetCardInfoMonth, 
    SetCardInfoYear, 
    SetCardInfoCVC,
};
